●メーカー名：和平フレイズ(株)　●サイズ/仕様：大 ●商品サイズ：幅約365mm×奥行き約260mm×高さ約2mm。●商品重量：約170g。●スチレン系エラストマー樹脂、ポリプロピレン。●生産国：日本。 ●右利き、左利きに対応できる目盛りつきで便利です。レシピによく出る「1cm幅」「3cm幅」もひとめでわかります。●シートを丸めれば、切った食材をそのまま鍋に移せます。みじん切りにした野菜もこぼさず鍋へ。●弾力のある樹脂製なので刃当たりがやわらかく、堅い食材を切ってもすべらず、音も響きにくくなっています。 

